import React, { useEffect, useState } from 'react';
import axios from 'axios';
import EVBarChart from './components/BarChart';

const App = () => {
  const [evByMake, setEvByMake] = useState([]);
  const [evByYear, setEvByYear] = useState([]);
  const [evByCounty, setEvByCounty] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      const makeResult = await axios.get('http://localhost:5000/api/ev-by-make');
      const yearResult = await axios.get('http://localhost:5000/api/ev-by-year');
      const countyResult = await axios.get('http://localhost:5000/api/ev-by-county');

      setEvByMake(makeResult.data);
      setEvByYear(yearResult.data);
      setEvByCounty(countyResult.data);
    };
    fetchData();
  }, []);

  return (
    <div>
      <h1>EV Dashboard</h1>
      <EVBarChart data={evByMake} title="EVs by Make" dataKey="Count" xAxisKey="Make" />
      <EVBarChart data={evByYear} title="EVs by Model Year" dataKey="Count" xAxisKey="Model Year" />
      <EVBarChart data={evByCounty} title="EVs by County" dataKey="Count" xAxisKey="County" />
    </div>
  );
};

export default App;
